import React from "react";
import UserProvider from "../hooks/useUsers";
import { useAuth } from "../"

const SelectedPage = () => {
    const { currentUser } = useAuth();
    return (
        <>
            <UserProvider>
                <h1>SelectedPage</h1>
            </UserProvider>
        </>
    );
};

export default SelectedPage;
